import React from 'react';
import StringInStamp from './StringInStamp';

function Stamp({heading, string}) {
  return (
    <div>

      <div>
      {heading}
      </div>
      <div>
        {string && string.map((item, index) => <StringInStamp key={(index + 1)*Math.random()} item={item}/>)}
      </div>
    </div>
  );
}

export default Stamp;
